import { Component, OnInit } from '@angular/core';
import { FormControl } from '@angular/forms';
import { Router } from '@angular/router';
import { BookService } from '../book.service';
import { User } from '../model/user';

//TREBA DA UNESE I RASPOREDI VISE AUTORA U LISTU< TREBA PADAJUCA LISTA ZANROVA

@Component({
  selector: 'app-add-book',
  templateUrl: './add-book.component.html',
  styleUrls: ['./add-book.component.css']
})
export class AddBookComponent implements OnInit {

  constructor(private bookService: BookService, private router: Router) { }

  ngOnInit(): void {
    if (JSON.parse(sessionStorage.getItem("reader"))!=null) {
      this.user=JSON.parse(sessionStorage.getItem("reader"));
    } else if (JSON.parse(sessionStorage.getItem("moderator"))!=null) {
      this.user=JSON.parse(sessionStorage.getItem("moderator"));
    } else if (JSON.parse(sessionStorage.getItem("admin"))!=null) {
      this.user=JSON.parse(sessionStorage.getItem("admin"));
    } else {
      this.user = new User();
      this.user.tip = 'prazan';
      if (this.user.tip=='prazan'||this.user.blokiran==true) {
        this.router.navigate(['']);
      }
    }

    this.picture="";
    this.publisher="";
    this.language="";
    this.authors=[];
    this.genres=[];
    this.name="";
    this.year=0;
  }

  user:User;
  name: string;
  publisher: string;
  year: number;
  language: string;
  author: string;
  authors: string[];
  genres: string[];
  picture: string;

  genreFormControl = new FormControl('');
  genreList: string[] = ['Crime', 'Comedy', 'Drama', 'Cooking', 'Fiction', 'Art', 'Manga', 'Horror', 'Romantic', 'Feelgood'];

  message: string;

  logout(){
    sessionStorage.clear()
    this.router.navigate([''])
  }

  changePicture(img) {
    if(img.target.files && img.target.files[0]) {
      this.picture=this.getBase64(img);
    }
  }

  add(){
    this.message="You must fill out: "
    if (this.publisher=="") { this.message+="Publisher; "}
    if (this.name=="") { this.message+="Name; "}
    if (this.author=="") {this.message+="Author; "}
    if (this.genres.length==0) {this.message+="Genre; "}
    if (this.year==0) {this.message+="Year; "}
    if (this.language=="") {this.message+="Language; "}
    if (this.message=="You must fill out: ") {
      if (this.genres.length<4) {
        let i = 0;
        let authorName = '';
        this.authors = [];
        while(true) {
          if(i==this.author.length) {
            this.authors.push(authorName);
            break;
          }
          if(this.author[i]==',') {
            this.authors.push(authorName);
            authorName='';
          } else if(authorName=='' && this.author[i]==' ') {
          } else {
            authorName += this.author[i];
          }
          i++;

          if (this.picture=="") {this.picture=this.defaultPicture;}
          this.bookService.add(this.name, this.year, this.language, this.authors, this.genres, this.publisher, this.picture, this.user).subscribe(respObj=>{
            if(respObj['message']=='ok'){
              this.message = 'Book added'
            }
            else{
              this.message = 'Error'
            }
          });
        }
      } else {
        this.message="You can select up to 3 genres."
      }
    } else {

    }
  }

  getBase64(event) {
    let file = event.target.files[0];
    let reader = new FileReader();
    reader.readAsDataURL(file);
    reader.onload = (e) => {
      //data:image/jpeg;base64,
      const slika = e.target.result.slice(22);
      this.picture = slika.toString();
    };
    reader.onerror = function (error) {
      console.log('Error: ', error);
    };
    return "";
 }

  defaultPicture = "";

}
